document.addEventListener("DOMContentLoaded", () => {
    let combos = [
        {
            id: "C1",
            nombre: "Combo 1",
            descripcion: "Agua fresca saborizada con flor de jamaica acompa√±ada con una torta ahogada",
            alimentos: ["Torta ahogada"],
            bebidas: ["Jamaica"],
            foto: "data:image/jpeg;base64,",
            estatus: "Activo"
        },
        {
            id: "C2",
            nombre: "Combo 2",
            descripcion: "Caf√© con leche y tamales",
            alimentos: ["Tamales"],
            bebidas: ["Caf√© con leche"],
            foto: "data:image/jpeg;base64,",
            estatus: "Activo"
        },
        {
            id: "C3",
            nombre: "Combo 3",
            descripcion: "Huevos rancheros y jugo de naranja",
            alimentos: ["Huevos Rancheros"],
            bebidas: ["Jugo de naranja"],
            foto: "data:image/jpeg;base64,",
            estatus: "Activo"
        },
        {
            id: "C4",
            nombre: "Combo 4",
            descripcion: "Enchiladas verdes con caf√©",
            alimentos: ["Enchiladas verdes"],
            bebidas: ["Caf√©"],
            foto: "data:image/jpeg;base64,",
            estatus: "Activo"
        }
    ];

    const comboTableBody = document.getElementById("comboTableBody");

    function renderCombos() {
        comboTableBody.innerHTML = "";
        combos.forEach((combo, index) => {
            const row = document.createElement("tr");
            row.innerHTML = `
                <td>${combo.id}</td>
                <td>${combo.nombre}</td>
                <td>${combo.descripcion}</td>
                <td>${combo.alimentos.join(", ")}</td>
                <td>${combo.bebidas.join(", ")}</td>
                <td><img src="${combo.foto}" alt="Foto" style="width: 50px; height: 50px;"/></td>
                <td>${combo.estatus}</td>
                <td>
                    <button class="btn btn-edit btn-sm" data-index="${index}" data-toggle="modal" data-target="#editUserModal">Editar</button>
                    <button class="btn btn-delete btn-sm" data-index="${index}">Eliminar</button>
                </td>
            `;
            comboTableBody.appendChild(row);
        });
    }

    renderCombos();

    document.getElementById("addComboForm").addEventListener("submit", function(e) {
        e.preventDefault();
        const newCombo = {
            id: `C${combos.length + 1}`,
            nombre: e.target.producto.value,
            descripcion: e.target.Descripcion.value,
            alimentos: Array.from(e.target.entidades1.selectedOptions).map(option => option.value),
            bebidas: Array.from(e.target.entidades2.selectedOptions).map(option => option.value),
            foto: e.target.Foto.value || "data:image/png;base64,...", // Imagen por defecto si no se proporciona
            estatus: "Activo"
        };
        combos.push(newCombo);
        renderCombos();
        $('#addUserModal').modal('hide');
    });

    document.getElementById("consultComboForm").addEventListener("submit", function(e) {
        e.preventDefault();
        const id = e.target.id.value;
        const combo = combos.find(combo => combo.id === id);
        if (combo) {
            alert(`ID: ${combo.id}\nNombre: ${combo.nombre}\nDescripci√≥n: ${combo.descripcion}\nAlimentos: ${combo.alimentos.join(", ")}\nBebidas: ${combo.bebidas.join(", ")}\nEstatus: ${combo.estatus}`);
        } else {
            alert("Combo no encontrado");
        }
    });

    document.addEventListener("click", function(e) {
        if (e.target.classList.contains("btn-delete")) {
            const index = e.target.getAttribute("data-index");
            combos.splice(index, 1);
            renderCombos();
        }
    });

    document.addEventListener("click", function(e) {
        if (e.target.classList.contains("btn-edit")) {
            const index = e.target.getAttribute("data-index");
            const combo = combos[index];
            const form = document.getElementById("editComboForm");
            form.producto.value = combo.nombre;
            form.Descripcion.value = combo.descripcion;
            form.Foto.value = combo.foto;
            Array.from(form.entidades1.options).forEach(option => {
                option.selected = combo.alimentos.includes(option.value);
            });
            Array.from(form.entidades2.options).forEach(option => {
                option.selected = combo.bebidas.includes(option.value);
            });
            form.estatus.value = combo.estatus;

            form.onsubmit = function(e) {
                e.preventDefault();
                combo.nombre = form.producto.value || combo.nombre;
                combo.descripcion = form.Descripcion.value || combo.descripcion;
                combo.foto = form.Foto.value || combo.foto;
                combo.alimentos = Array.from(form.entidades1.selectedOptions).map(option => option.value) || combo.alimentos;
                combo.bebidas = Array.from(form.entidades2.selectedOptions).map(option => option.value) || combo.bebidas;
                combo.estatus = form.estatus.value || combo.estatus;
                renderCombos();
                $('#editUserModal').modal('hide');
            };
        }
    });
});

